description:
A MyUnitel é a aplicação da Unitel que te permite gerir a tua conta.

Faz o teu registo e aproveita todas as funcionalidades que disponibilizamos para ti.

- Registo e login mais simplificado e rápido;
- Maior segurança e protecção dos dados do cliente por meio da utilização da autenticação biométrica e OTP;
- Maior conforto na experiencia de utilização, através de uma interface pensada para atender as necessidades do cliente;
- Maior facilidade e mais fluidez na gestão dos serviços, planos, tarifários e pagamentos Unitel;
- Facilidade na visualização dos eventos de carregamentos e consumos de saldos de voz, dados e SMS;
- Facilidade na interacção com os diferentes canais de apoio ao cliente por meio de uma área de dedicada;
- Acesso rápido e fácil às informações sobre os serviços, planos e lojas Unitel sem precisar de sair da App;
- Gestão integral da oferta NET CASA 4G e 5G;
- Maior integração com as funcionalidades nativas do sistema operativo iOS (Por exemplo: Lista telefónica);
- Imagem/interface mais moderna e totalmente ajustada à marca Unitel.
